    +(NSDictionary<NSString *, NSNumber *> *)nameVariableMap {
        static NSDictionary    *_dict = nil;
        static dispatch_once_t _flag  = 0;
        dispatch_once(&_flag, ^{
            NSDictionary<NSNumber *, NSString *>        *map = self.variableNameMap;
            NSMutableDictionary<NSString *, NSNumber *> *d   = [NSMutableDictionary dictionaryWithCapacity:map.count];
            [map enumerateKeysAndObjectsUsingBlock:^(NSNumber *key, NSString *obj, BOOL *stop) { d[obj] = key; }];
            _dict = d;
        });
        return _dict;
    }

